// SPDX-License-Identifier: MIT

pragma solidity 0.8.9;

import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

/**
 @title Contract to issue tokens based on the distribution pool.
 The tokens in a pool are distributed equally among the beneficiaries
 based on the *total issued tokens*
 */
contract FanTokenIssuance is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    enum DistributionType {
        TEAM,
        SEED,
        STRATEGIC,
        PRIVATE1,
        PRIVATE2,
        PUBLIC,
        ADVISORS,
        LIQUIDITY,
        REWARDS,
        MARKETING,
        RESERVES,
        ECOSYSTEM
    }

    event IssuanceAdded(
        DistributionType indexed poolType,
        uint256 issuedAmount
    );

    event BeneficiariesAdded(
        DistributionType indexed poolType,
        address[] beneficiaries
    );

    event BeneficiariesRemoved(
        DistributionType indexed poolType,
        address[] beneficiaries
    );

    event TokensWithdrawn(
        DistributionType indexed poolType,
        address indexed beneficiary,
        uint256 withdrawnAmount
    );

    IERC20 private _fanToken;

    /**
      @dev The beneficiaries mapping doesnt give the 
      total number of beneficiaries. So the count is
      tracked separately. 
     */
    struct TokenIssuance {
        mapping(address => bool) beneficiaries;
        uint256 beneficiariesCount;
        DistributionType poolType;
        uint256 totalIssued;
    }

    mapping(DistributionType => TokenIssuance)
        public distributionTypeToIssuance;

    mapping(DistributionType => mapping(address => uint256))
        public distributionTypeToWithdrawals;

    constructor(address _token) {
        require(
            address(_token) != address(0x0),
            "FAW token address is not valid"
        );
        _fanToken = IERC20(_token);
    }

    /**
      @dev Adds new issuance to the `_distributionType` pool. This will be called daily
      @param _distributionType The type of the pool
      @param _issuanceAmount The amount of tokens to be issued in this batch
      @return success true if the issuance was added successfully.
     */
    function addTokenIssuance(
        DistributionType _distributionType,
        uint256 _issuanceAmount
    ) public onlyOwner returns (bool success) {
        require(_issuanceAmount > 0, "Empty issuance amount");
        uint256 totalSupply = _fanToken.totalSupply();
        require(
            _issuanceAmount <= totalSupply,
            "Cannot issue more than total supply"
        );

        TokenIssuance storage issuance = distributionTypeToIssuance[
            _distributionType
        ];
        if (issuance.totalIssued > 0) {
            issuance.totalIssued = issuance.totalIssued.add(_issuanceAmount);
        } else {
            issuance.totalIssued = _issuanceAmount;
        }
        issuance.poolType = _distributionType;

        emit IssuanceAdded(_distributionType, _issuanceAmount);

        return true;
    }

    /**
      Add beneficiaries to the `_distributionType` pool.
      A beneficiary can belong to more than one pool
      @param _beneficiaries The beneficiaries to be added
      @param _distributionType The type of the pool
    */
    function addBeneficiaries(
        address[] memory _beneficiaries,
        DistributionType _distributionType
    ) public onlyOwner {
        TokenIssuance storage issuance = distributionTypeToIssuance[
            _distributionType
        ];
        for (uint256 i = 0; i < _beneficiaries.length; i++) {
            if (!issuance.beneficiaries[_beneficiaries[i]]) {
                // Increment beneficiary count only if the beneficiary is not already in the pool
                issuance.beneficiaries[_beneficiaries[i]] = true;
                issuance.beneficiariesCount = issuance.beneficiariesCount.add(
                    1
                );
            }
        }

        emit BeneficiariesAdded(_distributionType, _beneficiaries);
    }

    /**
      Remove beneficiaries from the `_distributionType` pool.
      @param _beneficiaries The beneficiaries to be removed
      @param _distributionType The type of the pool
    */
    function removeBeneficiaries(
        address[] memory _beneficiaries,
        DistributionType _distributionType
    ) public onlyOwner {
        TokenIssuance storage issuance = distributionTypeToIssuance[
            _distributionType
        ];
        for (uint256 i = 0; i < _beneficiaries.length; i++) {
            if (issuance.beneficiaries[_beneficiaries[i]]) {
                // Decrement beneficiary count only if the beneficiary is not already in the pool
                delete issuance.beneficiaries[_beneficiaries[i]];
                issuance.beneficiariesCount = issuance.beneficiariesCount.sub(
                    1
                );
            }
        }

        emit BeneficiariesRemoved(_distributionType, _beneficiaries);
    }

    function getWithdrawableAmount(DistributionType _distributionType)
        public
        view
        returns (uint256)
    {
        bool isValidBeneficiary = distributionTypeToIssuance[_distributionType]
            .beneficiaries[msg.sender];

        require(isValidBeneficiary, "Beneficiary not found in pool");
        // Since msg.sender is already in the pool, beneficiariesCount > 0
        return
            (
                distributionTypeToIssuance[_distributionType].totalIssued.div(
                    distributionTypeToIssuance[_distributionType]
                        .beneficiariesCount
                )
            ).sub(distributionTypeToWithdrawals[_distributionType][msg.sender]);
    }

    function withdraw(
        DistributionType _distributionType,
        uint256 withdrawAmount
    ) public payable returns (bool withdrawalSuccess) {
        uint256 withdrawableAmount = getWithdrawableAmount(_distributionType);
        uint256 withdrawnAmount = distributionTypeToWithdrawals[
            _distributionType
        ][msg.sender];

        require(withdrawableAmount > 0, "No amount to withdraw");
        require(
            withdrawableAmount >= withdrawnAmount.add(withdrawAmount),
            "Withdraw amount exceeds available amount."
        );

        distributionTypeToWithdrawals[_distributionType][
            msg.sender
        ] = withdrawAmount.add(withdrawnAmount);

        // Transfer the amount in the end to avoid reentrancy attacks
        _fanToken.safeTransfer(msg.sender, withdrawAmount);

        emit TokensWithdrawn(_distributionType, msg.sender, withdrawAmount);

        return true;
    }

    function getWithdrawnAmount(DistributionType _distributionType)
        external
        view
        returns (uint256)
    {
        return distributionTypeToWithdrawals[_distributionType][msg.sender];
    }
}

